// import './Flights.css';

function Currency() {
    const [currencies, setCurrencies] = useState([])

    async function fetchMyAPI() {
        const reqOptions = {
            method: 'GET',
            headers: {
                "x-rapidapi-key": "9c838d17b0msh9d78bbfa4f324fbp109103jsn16509938ea2e",
                "x-rapidapi-host": "skyscanner-skyscanner-flight-search-v1.p.rapidapi.com",
                "useQueryString": true
            }
        }

        var response
        response = await fetch("https://skyscanner-skyscanner-flight-search-v1.p.rapidapi.com/apiservices/reference/v1.0/currencies", reqOptions)
        response = await response.json()
        console.log(response.Currencies)
        setCurrencies(response.Currencies)
        if (response.Currencies === undefined) {
            return
        }
    }

    fetchMyAPI()

    return(
        <div className="currencies">
            {currencies.map(currency => {
                        return (<option id={currency.Code}>currency.Symbol</option>);
            })}
         </div>
    )
}

export default Currency;
